import { StylesProvider } from "@material-ui/core";
import React from "react";
import {
  StyleSheet, Text, Image, View, TouchableOpacity, Vibration,Linking,
} from 'react-native';
// import 'rc-footer/assets/index.css'; 

class Footer extends React.Component{
  render(){
    return(
      
      <View style={{flex:1, flexDirection:'row', alignItems:'center'}}>
       
        
        <View style={{width:50,height:50, marginRight:50, marginLeft:350,marginTop:20, marginBottom:20}}>
      <Text onPress={()=>Linking.openURL("https://www.youtube.com/c/jamesqquick")}>
      <Image style={{width:50,height:50}}
      source={require('../assets/youtube.png')}/></Text></View>

<View style={{width:50,height:50, marginRight:50,marginTop:20,  marginBottom:20}}>
      <Text onPress={()=>Linking.openURL("https://www.twitter.com/jamesqquick")}>
      <Image style={{width:50,height:50}}
      source={require('../assets/twitter.png')}/></Text></View>

<View style={{width:50, height:50, marginRight:50, marginTop:20,  marginBottom:20}}>
      <Text onPress={()=>Linking.openURL("https://www.facebook.com/learnbuildteach/")}>
      <Image style={{width:50,height:50}}
      source={require('../assets/facebook.png')}/></Text></View>


<View style={{width:50, height:50, marginRight:50, marginTop:20,  marginBottom:20}}>
      <Text onPress={()=>Linking.openURL("https://www.instagram.com/learnbuildteach")}>
      <Image style={{width:30,height:30}}
      source={require('../assets/instagram.png')}/></Text></View>



        
      </View>
      
    );
  }
}
